angular.module("app").controller("AddRecipeControl", function ($location, $timeout, RecipeFactory, AuthFactory) {
	var addCtrl = this;

	addCtrl.grainBill = [];
	addCtrl.hopsBill = [];

	RecipeFactory.styles().then(function (res) {
		return addCtrl.stylesArray = res.data.map(function (style) {
			return style.shortName;
		});
	});
	RecipeFactory.fermentables().then(function (res) {
		return addCtrl.fermentablesArray = res.data.map(function (ferm) {
			return ferm.name;
		});
	});
	RecipeFactory.hops().then(function (res) {
		return addCtrl.hopsArray = res.data.map(function (hop) {
			return hop.name;
		});
	});
	RecipeFactory.yeast().then(function (res) {
		return addCtrl.yeastArray = res.data.map(function (yeast) {
			return yeast.name;
		});
	});
	RecipeFactory.srm().then(function (res) {
		return addCtrl.srmArray = res.data;
	});

	// addCtrl.backToProfile = function () {
	// 	let currentUser = AuthFactory.currentUser();
	// 	$location.path(`/profile/${currentUser.userId}`);
	// }

	addCtrl.addFermentable = function () {
		addCtrl.grainBill.push({});
	};

	addCtrl.addHops = function () {
		addCtrl.hopsBill.push({});
	};

	addCtrl.deleteFerm = function (obj) {
		var deleteIndex = addCtrl.grainBill.indexOf(obj);
		addCtrl.grainBill.splice(deleteIndex, 1);
	};

	addCtrl.deleteHop = function (obj) {
		var deleteIndex = addCtrl.hopsBill.indexOf(obj);
		addCtrl.hopsBill.splice(deleteIndex, 1);
	};

	addCtrl.addNew = function () {
		var currentUser = AuthFactory.currentUser();
		var recipe = {
			uid: currentUser.userId,
			brewer: currentUser.email,
			name: addCtrl.name,
			description: addCtrl.description,
			style: addCtrl.style,
			targetOG: parseFloat(addCtrl.targetOG),
			targetFG: parseFloat(addCtrl.targetFG),
			batchSize: parseFloat(addCtrl.batchSize),
			mashTemp: parseFloat(addCtrl.mashTemp),
			mashEff: parseInt(addCtrl.mashEff),
			grainBill: addCtrl.grainBill,
			hops: addCtrl.hopsBill,
			yeast: {
				name: addCtrl.yeast,
				starter: addCtrl.yeastStarter
			},
			comments: addCtrl.comments
		};
		console.log("recipe: ", recipe);

		RecipeFactory.addNewRecipe(recipe).then($location.path.bind($location, "/profile/" + currentUser.userId)).then($timeout);
	};

	addCtrl.cancel = function () {
		var currentUser = AuthFactory.currentUser();
		$location.path("/profile/" + currentUser.userId);
	};
});
